INSERT INTO `xx_jbxx` VALUES ('29ef79ea24da4fb7949aaaec4ee9f523', '4104221001', '测试学校001', NULL, '昆阳街道办事处', NULL, '111', '410422000000', '河南省平顶山市叶县教育局', '410422000000', '河南省平顶山市叶县教育局', '211', '111', '张雪', NULL, '1234567', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 113, 33, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, '7258', '20180604 20:54:55', '1', '2019-01-28 19:30:12', NULL, '<img src=\"/xxfzgl/xxfzgl/common/commonFile.do?method=getImgFile=20181113150539262.png\" alt=\"\" /><span style=\"font-size:16px;\">; ; ; ;</span><span style=\"font-size:16px;\">学校是叶县唯一的一所县直全日制九年一贯制中、小学校（内设初中部、小学部）。2001年征地建校，2002年秋季开始招生。位于县城文化路中段北侧，占地面积71亩，校舍建筑面积5500平方米，现有教职工76人，任课教师70人，其中本科5人，大专53人，中师;12人，中级职称;15人，初级职称50人，工人6人。现有21个教学班，其中小学阶段17个教学班，初中阶段4个教学班，在校生共1239人。</span>\n<p>\n	<span style=\"font-size:16px;\">; ; ; ;该校坚持以德育为首，以教学为中心，以改善办学条件为龙头，以“外树形象、内抓管理”为原则，以全面发展、提高质量、创办特色学校为根本宗旨，深化了教学改革、强化了教学管理，建立健全了考评、激励和竞争机制。素质教育全面推进，办学水平不断提高。教师敬业。学生勤奋，全校上下呈现出一派生机勃勃、昂扬向上的良好势头。建校仅一年多来，已取得骄人成绩，在县组织的中小学书画比赛和小学生毕业调研考试中均名列榜首，“五四”中队、“五六”中队被授予平顶山市“雷锋中队”称号，学校被评为市依法治教先进单位，治理中小学乱收费先进单位，校长韩会广同志被评为市级科技创新和素质教育优秀工作者，副校长李秀花同志被评为市级优秀教师，政教主任蒋联生同志被评为市级德育工作先进个人，教育科研喜结硕果。一年来共撰写科研论文228篇，其中75篇荣获市级论文奖。</span><br />\n<span style=\"font-size:16px;\">;;拥有一支政治觉悟高、业务素质强、师德形象美的教师队伍，其中省级青年骨干教师3人、市级青年骨干教师11人，省级优质课教师4人，市级优质课教师12人，县级优质课教师17人。</span><br />\n	<p>\n		<span style=\"font-size:16px;\">;;拥有一个“团结、开拓、进取”的富有凝聚力的领导班子，大家共同发出的只有一个声音，就是干工作、拼质量，抱定的只有一个目标，就是办特色、创名校，崇尚的只有一种精神，就是办实事、做真人。</span>\n	</p>\n	<p>\n		<span style=\"font-size:16px;\"><img class=\"currentImg\" id=\"currentImg\" src=\"https://timgsa.baidu.com/timg?image;quality=80;size=b9999_10000;sec=1542106953793;di=15bcca18be06c03766f7e9a169cd9d18;imgtype=0;src=http%3A%2F%2Fimgsrc.baidu.com%2Fforum%2Fw%3D580%2Fsign%3Db619204f962f07085f052a08d925b865%2Fa1416bc6a7efce1bacd9facaa751f3deb58f6569.jpg\" style=\"width:580px;height:325px;\" title=\"点击查看源网页\" width=\"580\" height=\"325\" /><br />\n</span>\n	</p>\n</p>\n<p>\n	<br />\n</p>', '410422002000', '301');
