INSERT INTO `xx_jbxx` VALUES ('40af0035199a4713a5d12fc2b6780bcb', '412202121', '测试学校003', NULL, '你心里', NULL, '210', '410422000000', '河南省平顶山市叶县教育局', '410422000000', '河南省平顶山市叶县教育局', '211', '999', '更新', NULL, '6012456', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 113, 33, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, '7258', '20180607 15:01:00', '20001', '2019-01-28 19:30:12', NULL, '<p>\n	叶县高中创建于1956年，是河南省文明单位、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%B2%B3%E5%8D%97%E7%9C%81%E7%A4%BA%E8%8C%83%E6%80%A7%E6%99%AE%E9%80%9A%E9%AB%98%E4%B8%AD\">河南省示范性普通高中</a>、河南省园林单位、河南省人民政府授予的教育先进单位。学校位于古城昆阳西南，灰河之滨，北校区占地面积280亩，南校区占地面积150亩，建筑面积30万余平方米，建筑格局合理，教学设施先进。有高标准教学楼、实验楼、图书楼、学生公寓、教师公寓等；有标准田径场、足球场；有一流的实验室、多媒体教室、电子备课室。教室全部配备有<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%97%AD%E8%B7%AF%E7%94%B5%E8%A7%86/784718\">闭路电视</a>系统、多媒体教学设备等。任课教师配备了笔记本电脑，学校建立了网络中心，基本实现了办公和教学手段的现代化。\n</p>\n<p>\n	<img src=\"/xxfzgl/xxfzgl/common/commonFile.do?method=getImgFile=20181116154014831.jpg\" alt=\"\" />\n</p>\n<p>\n	学校坚持“以人为本、以德治校、民生管理、开放办学”的教育理念。以“师资一流、设施一流、服务一流、环境一流、质量一流”为目标，形成了“全员管理、全面发展”的管理模式；秉承”自强不息、厚德载物”的校训和”博学、勤勉、求实、创新”的学风,全面贯彻党的教育方针。积极推进素质教育，突出能力培养为核心的育人思路，全面提高学生综合素质。改革开放以来，先后为国家培养出13000多名高中毕业生，升入高等院校学生11000余人，有33人考取清华、北大，900多人获硕士学位，600余人取得博士学位，400多人出国深造，历年来，高考成绩一直居全市领先地位。\n</p>\n<p>\n	<br />\n</p>\n<p>\n	<img src=\"http://127.0.0.1:8080/xxfzgl/xxfzgl/common/commonFile.do?method=getImgFile=20181116091051555.jpg\" alt=\"\" /> \n</p>\n<p>\n	<img src=\"http://127.0.0.1:8080/xxfzgl/xxfzgl/common/commonFile.do?method=getImgFile=20181116091018321.jpg\" alt=\"\" /> \n</p>', '410422002000', '303');
