INSERT INTO `xx_jbxx` VALUES ('a550d781a4104a648db82e88e34b5130', '412202111', '测试学校002', NULL, '我心里', NULL, '111', '410422000000', '河南省平顶山市叶县教育局', '410422000000', '河南省平顶山市叶县教育局', '311', '999', 'zomie', NULL, '6025756', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 113, 33, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, '7258', '20180606 17:43:47', '7253', '2019-01-28 19:30:12', NULL, '学校是叶县唯一的一所县直全日制九年一贯制中、小学校（内设初中部、小学部）。2001年征地建校，2002年秋季开始招生。位于县城文化路中段北侧，占地面积71亩，校舍建筑面积5500平方米，现有教职工76人，任课教师70人，其中本科5人，大专53人，中师 12人，中级职称 15人，初级职称50人，工人6人。现有21个教学班，其中小学阶段17个教学班，初中阶段4个教学班，在校生共1239人。<br />\n该校坚持以德育为首，以教学为中心，以改善办学条件为龙头，以“外树形象、内抓管理”为原则，以全面发展、提高质量、创办特色学校为根本宗旨，深化了教学改革、强化了教学管理，建立健全了考评、激励和竞争机制。素质教育全面推进，办学水平不断提高。教师敬业。学生勤奋，全校上下呈现出一派生机勃勃、昂扬向上的良好势头。建校仅一年多来，已取得骄人成绩，在县组织的中小学书画比赛和小学生毕业调研考试中均名列榜首，“五四”中队、“五六”中队被授予平顶山市“雷锋中队”称号，学校被评为市依法治教先进单位，治理中小学乱收费先进单位，校长韩会广同志被评为市级科技创新和素质教育优秀工作者，副校长李秀花同志被评为市级优秀教师，政教主任蒋联生同志被评为市级德育工作先进个人，教育科研喜结硕果。一年来共撰写科研论文228篇，其中75篇荣获市级论文奖。<br />\nxxx;xxx;拥有一支政治觉悟高、业务素质强、师德形象美的教师队伍，其中省级青年骨干教师3人、市级青年骨干教师11人，省级优质课教师4人，市级优质课教师12人，县级优质课教师17人。<br />\nxxx;xxx;拥有一个“团结、开拓、进取”的富有凝聚力的领导班子，大家共同发出的只有一个声音，就是干工作、拼质量，抱定的只有一个目标，就是办特色、创名校，崇尚的只有一种精神，就是办实事、做真人。<br />\nxxx;xxx;一整套科学的管理制度已经建立健全，学校实行“五化”管理，即领导岗位责任量化、班主任工作量化、教师考评量化、班级检查评比量化、学生表现量化。充分调动了广大教职员工的工作积极性、主动性、创造性，启动了学校活力，各项工作得到协调、健康、有序运行。<br />\nxxx;xxx;兴教育科研之风，走科研兴校之路的氛围已经形成，学校支持“全员搞科研”，组织全体任课教师针对自己教育教学中迫切需要解决的问题，选定自己的课题，科研处每月总结出一期《科研园地》，鼓励全体教师总结经验，撰写论文，形成了浓厚的科研气氛，鼓励全体教师大胆尝试教法。将集知识性和趣味性、直观性为一体的启发式、直观式教学方法广泛运用到课堂教学之中，在小学五年级和初中一年级实行大班分治的改革实验取得显著成效。为大面积提高教育教学质量闯出了新路。致力于构筑学习型教师团队，强力推行“五个一”的科研工程，即每位教师每学期学习一本教育理论专著。每学期整理一本教育科研笔记，每学期上一节教研公开课，每学期撰写一篇科研论文，每学年搞一个教研专题，努力使同志们从“教书匠”向“研究型”、“学者型”的教育专家转变，把叶县实验学校办成了一所教师进修学校，使同志们边工作、边培训、边提高，为叶县教育系统塑造了一支素质高、业务精、作风正、科研型的教师队伍。<br />\nxxx;xxx;<br />', '410422002000', '302');
